script: |
  super -f text -I q13434.spq | sort > q13434.out

inputs:
  - name: q13434.spq
    data: |
      SELECT ALL 61 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( NOT ( + col2 ) * + ( - + col2 ) * + 55 IS NOT NULL );
  - name: tab2

outputs:
  - name: q13434.out
    data: |
      61
      61
      61
